// Import necessary modules and components
import React from 'react';
import './Login.css';

// Define the Login component
const Login = () => {
  return (
    <div className="login-container">
         <h2>Welcome Back!</h2>
      <div className="box">
     
        <form>
          <label>
            <input type="text" name="username" placeholder="Username" />
          </label>
          <label>
            <input type="password" name="password" placeholder="Password" />
          </label>
          <button type="submit">Login</button>
          <button type="button">Create a new account</button>
          <p className="signup-link">Don't have an account? <a href="/farmer_signup">Sign Up</a></p>
        <p className="join-link">Join as a Farmer <a className="green-link" href="/farmer_signup">here</a></p>
          
        </form>
        <div className="link"></div>
       
      </div>

    </div>
  );
};

// Export the Login component
export default Login;
